import React from 'react';
import ReactDOM from 'react-dom';

export const TaskMenu = () => {
    const overlay = {
        position: 'fixed',
        left: '30px',
        top: '10px',
        background: 'goldenrod',
        width: '100px',
        height: '100px',
        zIndex: '1'
    };
    return ( 
    <div className='overlay' >
        <div className='task-menu' >
            <h2>Task</h2>
        </div>
    </div>
    );
};
